function editAgency(n){$("#Id").val(n.id);$("#Email").val(n.email);$("#FirstName").val(n.firstName);$("#LastName").val(n.lastName);$("#Phone").val(n.phone);$("#AltPhone").val(n.altPhone);$("#Fax").val(n.fax);$("#EstimateWishes").val(n.estimateWishes);agencyRole=n.roles;$("#editAgencyModal").modal("show")}var agencyRole=null;$("#submit").on("click",function(){if(agencyRole=="Leader"&&($("#Archive").val()=="true"||$("#IsActive").val()=="false")){swal({text:"You can't edit a leader's active status.",icon:"warning",buttons:!0});return}$("#Archive").val()=="true"?swal({text:"Archive will cause this user to no longer be visible, contact secret santa admin to change it back",icon:"warning",buttons:["Leave as is, return to prior screen","Ok to proceed"]}).then(n=>{if(n)$("#agencyForm").submit();else return}):$("#IsActive").val()=="false"?swal({text:"This user will not be permitted to log in, you can change this back later if you wish",icon:"warning",buttons:["Leave as is, return to prior screen","Ok to proceed"]}).then(n=>{if(n)$("#agencyForm").submit();else return}):$("#agencyForm").submit()});